padding: 1rem 0;

.container {
  display: grid;
  grid-template-columns: auto auto auto;
  place-items: center;

  .logo {
    display: flex;
    align-items: center;
    justify-self: flex-start;

    span {
     	font-size: 1.5rem;
      font-weight: 600;
    }

    img {
    	max-width: 10rem;
    }
  }

  nav.center {
    display: flex;
    justify-content: center;
    align-items: center;
  }

  .right {
    display: flex;
    justify-content: flex-end;
    align-items: center;
    justify-self: flex-end;

    .social-link {
      padding-right: 1rem;
    }

    .cta {
      font-weight: 600;
      padding: 0.5rem 1rem;
      border: 2px solid var(--color-accent);
      border-radius: 0.25rem;
      justify-self: flex-end;
      transition: color 0.1s, background 0.1s;

      &:hover {
        color: white;
        background: var(--color-accent);
      }
    }
  }
}

@media (max-width: 900px) {
  .container {
    grid-template-columns: 1fr;

    .logo {
      justify-self: center;
      margin-bottom: 1rem;
    }

    .right {
      margin-top: 1rem;
      justify-self: center;
    }
  }
}

section {
	color: #6B7280;
  position: relative;
  max-width: 1280px;
  padding: 0 2rem;
}

figure {
  position: relative;

  svg {
    position: absolute;
    top: 0;
  	bottom: 0;
    left: 0;
  	width: 100%;
  	height: 100%;
  	z-index: 0;
  	padding-top: 3rem;
  	padding-right: 3rem;

    rect {
      width: 100%;
      height: 100%;
      fill: currentcolor;
    }
  }

  img {
    width: 100%;
    position: relative;
    padding-left: 1rem;
  	padding-bottom: 1rem;
  }
}

.body {
  background: white;

  h1 {
    padding: 3rem;
  }

  .superhead {
    font-size: 1rem;
  	text-transform: uppercase;
  	display: flex;
    flex-direction: column;
  }

  .heading {
    font-size: 3rem;
    text-transform: capitalize;
  	font-weight: 500;
  	line-height: 3rem;
  }
}

@media screen and (min-width: 1000px) {
  .body {
    position: absolute;
    bottom: 0;
    left: 0;

    h1 {
      margin-bottom: 1.5rem;
    }
  }
  img {
    padding-left: 3rem;
    padding-bottom: 3rem;
  }
}

padding: 3rem 0;

.cards {
  display: grid;
  grid-template-columns: 1fr 1fr 1fr;
  grid-gap: 2rem;

  .card {
    color: #222;
    box-shadow: 0 0px 2px -1px rgb(0 0 0 / 10%), 0 2px 4px -1px rgb(0 0 0 / 6%);
		position: relative;
    background: white;

    &:after {
      background: white;
  		content: '';
      width: 100%;
      height: 100%;
      display: block;
      position: absolute;
      background: var(--color-accent);
      z-index: -1;
      right: -0.5rem;
      bottom: -0.5rem;
    }

    img {
      height: 15rem;
    	width: 100%;
    	object-fit: cover;
    	object-position: center;
    }

    .body {
      padding: 2rem;

      .title {
        font-weight: 600;
        font-size: 1.25rem;
      }

      .subtitle {

      }
    }
  }
}

@media (max-width: 600px) {
  .cards {
  	grid-template-columns: 1fr;

    .card {
      img {
				height: 10rem;
      }
    }
  }
}

footer {
/*   background-color: var(--color-text);	
  color: white;	 */
  border-top: 1px solid #ddd;
  padding: 3rem 0;
  transition: color 0.1s, opacity 0.1s;

  .container {

    .body {
      max-width: 600px;

      .title {
        color: var(--color-text);
        font-size: 1.125rem;
				text-transform: uppercase;
      	font-weight: 700;

        &:after {
          content: '';
          width: 5rem;
          height: 0.25rem;
          display: block;
          margin: 1rem 0;
          background: var(--color-accent);
        }
      }

      .subtitle {
        font-size: 0.875rem;
      	margin: 1rem 0;
      }

      ul {
        display: flex;
      	flex-wrap: wrap;
      	margin-bottom: 0.5rem;

        li {
          font-size: 0.875rem;
          text-decoration: underline;
          margin-right: 1rem;
        }
      }
    }

		.primo {
      transition: color 0.1s;
      text-decoration: underline;
			font-size: 0.75rem;
  		font-weight: bold;
  		&:hover { color:rgb(248,68,73) }
    }

    .social-links {
      border-bottom: 1px solid rgba(17, 24, 39);	

      .heading {
        font-size: 1.25rem;
				line-height: 1.75rem;
      	font-weight: bold;
      	margin-bottom: 1.5rem;
      }

      ul {
        display: flex;
        color: white;

        li {
      		font-size: 2.25rem;
          margin-right: 1rem;

          &:hover {opacity:0.8}
        }
      }
    }
